// WorkoutTable.js
import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import Axios from 'axios';

const WorkoutTable = () => {
  const { tableName } = useParams();
  const [tableData, setTableData] = useState([]);

  useEffect(() => {
    // Fetch data based on the table name
    Axios.get(`http://localhost:3001/${tableName}`)
      .then((response) => {
        setTableData(response.data);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
      });
  }, []);

  return (
    <div>
      <h2>{tableName}</h2>
      <table>
        <thead>
        <tr>
                <th>Name</th>
                <th>Sets</th>
                <th>Reps</th>
                <th>Weight</th>
                <th>Action</th>
              </tr>
        </thead>
        <tbody>
              {tableData.map(exercise => (
                <tr key={exercise.id}>
                  <td>{exercise.name}</td>
                  <td>{exercise.sets}</td>
                  <td>{exercise.reps}</td>
                  <td>{exercise.weight}</td>
                </tr>
              ))}
            </tbody>
      </table>


      <table>
        
            
          </table>


    </div>
  );
};

export default WorkoutTable;
